Een medewerkster van het Ministerie van Buitenlandse Zaken is onlangs
overgeplaatst naar de Amerikaanse ambassade in Londen. Ze krijgt de taak
om te voorkomen dat terroristen de Verenigde Staten binnen komen.
Al snel komt ze onder vuur te liggen en wordt ze bedreigd met de dood
en beschuldigd van misda den. Ze slaat op de vlucht en probeert
tegelijkertijd haar naam te zuiveren en een grote terroristische
aanslag te voorkomen.

Storyline

A State Department employee newly posted to the American embassy in London 
is charged with stopping terrorists from getting into the U.S. That puts 
her right in the line of fire and she is targeted for death and framed 
for crimes. Discredited, she is forced to go on the run while she tries 
to clear her name and stop a large-scale terrorist attack set for New 
Year's Eve in Times Square.



